<script>

(function(){
'use strict';

/* ---- STATE ---- */
var state='intro', introKeyDone=false;
var starDX=0, starDY=0;
var SPEED=5;
var SX=721.469, SY=507.753;
var keys={ArrowUp:false,ArrowDown:false,ArrowLeft:false,ArrowRight:false};
var collected=new Set();
var dlgTransitioning=false, contactCooldown=false;
var dlgId=null, dlgPage=1;
var ipCooldown=false;

/* ---- ELEMENT REFS ---- */
var starEl, introEl, eggEl, collEls=[];

var CFGS={
  'stardust-1':{t:'stardust-1-text',b:'stardust-1-nextbutton',p:4},
  'stardust-2':{t:'stardust-2-text',b:'stardust-2-nextbutton',p:4},
  'stardust-3':{t:'stardust-3-text',b:'stardust-3-nextbutton',p:4},
  'planet-1':  {t:'planet-1-text',  b:'planet-1-nextbutton',  p:4},
  'planet-2':  {t:'planet-2-text',  b:'planet-2-nextbutton',  p:4},
  'black-hole':{t:'blackhole-text', b:'blackhole-nextbutton', p:4},
  'dying-star':{t:'dyingstar-text', b:'dyingstar-nextbutton', p:4}
};

var CONTACT_IDS=['stardust-1','stardust-2','black-hole','planet-2','planet-1','dying-star','stardust-3'];
var COLL_IDS=['barrier','barrier_2','barrier_3','barrier_4','barrier_5',
              'barrier_6','barrier_7','barrier_8','barrier_9',
              'boundary','boundary_2','boundary_3','planet-2'];

/* ---- INIT ---- */
function init(){
  starEl=document.getElementById('star');
  introEl=document.getElementById('intro-text');
  eggEl=document.getElementById('easteregg');

  /* collect collision elements - prefer inner circle for accuracy */
  collEls=COLL_IDS.map(function(id){
    var el=document.getElementById(id);
    if(!el) return null;
    if(el.tagName.toLowerCase()==='g'){
      var c=el.querySelector('circle'); return c||el;
    }
    return el;
  }).filter(Boolean);

  /* hide initially hidden elements */
  var hidden=['planet-1-text','planet-2-text','blackhole-text','dyingstar-text',
    'stardust-1-text','stardust-2-text','stardust-3-text',
    'instruction-prompt','outro-text','star-pass',
    'planet-1-nextbutton','planet-2-nextbutton','blackhole-nextbutton','dyingstar-nextbutton',
    'stardust-1-nextbutton','stardust-2-nextbutton','stardust-3-nextbutton'];
  hidden.forEach(function(id){
    var el=document.getElementById(id);
    if(el){el.style.opacity='0';el.style.visibility='hidden';el.style.pointerEvents='none';}
  });

  /* easter egg hover */
  if(eggEl){
    eggEl.style.transformBox='fill-box';
    eggEl.style.transformOrigin='center';
    eggEl.style.animation='subtle-hover 4s ease-in-out infinite';
  }

  document.addEventListener('keydown',onKeyDown);
  document.addEventListener('keyup',onKeyUp);
  document.addEventListener('mousedown',function(){if(state==='ended')resetGame();});
  requestAnimationFrame(loop);
}

/* ---- KEY HANDLERS ---- */
function isArrow(k){return['ArrowUp','ArrowDown','ArrowLeft','ArrowRight'].indexOf(k)!==-1;}
function onKeyDown(e){
  if(isArrow(e.key))e.preventDefault();
  if(state==='intro'&&!introKeyDone&&isArrow(e.key)){introKeyDone=true;dismissIntro();return;}
  if(isArrow(e.key))keys[e.key]=true;
  if(state==='dialogue'){e.preventDefault();advanceDlg();}
  if(state==='ended')resetGame();
}
function onKeyUp(e){if(isArrow(e.key))keys[e.key]=false;}

/* ---- DISMISS INTRO ---- */
function dismissIntro(){
  if(!introEl){state='playing';return;}
  introEl.style.transformBox='fill-box';introEl.style.transformOrigin='center';
  introEl.style.transition='opacity 0.6s ease, transform 0.6s ease';
  introEl.style.transform='translateY(-40px)';
  introEl.style.opacity='0';
  setTimeout(function(){introEl.style.visibility='hidden';},650);
  state='playing';
}

/* ---- GAME LOOP ---- */
function loop(){
  if(state==='playing'){
    var dx=0,dy=0;
    if(keys.ArrowLeft)dx-=SPEED; if(keys.ArrowRight)dx+=SPEED;
    if(keys.ArrowUp)dy-=SPEED;   if(keys.ArrowDown)dy+=SPEED;
    if(dx||dy){tryMove(dx,dy);autoScroll();}
    checkContacts();
  }
  requestAnimationFrame(loop);
}

/* ---- STAR MOVEMENT ---- */
function applyTf(){starEl.setAttribute('transform','translate('+starDX+','+starDY+')');}
function tryMove(dx,dy){
  starDX+=dx;applyTf();
  if(collides()){starDX-=dx;applyTf();}
  starDY+=dy;applyTf();
  if(collides()){starDY-=dy;applyTf();}
}
function collides(){
  var s=starEl.getBoundingClientRect();
  var scx=s.left+s.width/2, scy=s.top+s.height/2, sr=s.width*0.38;
  for(var i=0;i<collEls.length;i++){
    var o=collEls[i], r=o.getBoundingClientRect();
    if(!r.width&&!r.height)continue;
    var ocx=r.left+r.width/2, ocy=r.top+r.height/2, or2=Math.min(r.width,r.height)/2;
    if(Math.hypot(scx-ocx,scy-ocy)<sr+or2)return true;
  }
  return false;
}

/* ---- AUTO SCROLL ---- */
function autoScroll(){
  var r=starEl.getBoundingClientRect();
  var sy=r.top+r.height/2, target=window.innerHeight*0.42;
  var d=sy-target;
  if(Math.abs(d)>40)window.scrollBy({top:d*0.12,behavior:'auto'});
}

/* ---- CONTACT DETECTION ---- */
function checkContacts(){
  if(contactCooldown)return;
  var s=starEl.getBoundingClientRect();
  var scx=s.left+s.width/2, scy=s.top+s.height/2, sr=s.width*0.52;
  for(var i=0;i<CONTACT_IDS.length;i++){
    var id=CONTACT_IDS[i];
    if(collected.has(id))continue;
    var el=document.getElementById(id);
    if(!el)continue;
    var r=el.getBoundingClientRect();
    if(!r.width&&!r.height)continue;
    var ocx=r.left+r.width/2, ocy=r.top+r.height/2, or2=Math.min(r.width,r.height)/2*0.8;
    if(Math.hypot(scx-ocx,scy-ocy)<sr+or2){handleContact(id);return;}
  }
}
function handleContact(id){
  if(id==='stardust-3'&&(!collected.has('stardust-1')||!collected.has('stardust-2'))){
    showIP();return;
  }
  contactCooldown=true;
  startDlg(id);
}

/* ---- INSTRUCTION PROMPT ---- */
function showIP(){
  if(ipCooldown)return; ipCooldown=true;
  var ip=document.getElementById('instruction-prompt');
  if(!ip){setTimeout(function(){ipCooldown=false;},2600);return;}
  try{
    var bb=ip.getBBox();
    var cx=bb.x+bb.width/2, cy=bb.y+bb.height/2;
    ip.setAttribute('transform','translate('+(SX+starDX-cx)+','+(SY+starDY+120-cy)+')');
  }catch(e){}
  ip.style.transition='opacity 0.4s ease';
  ip.style.opacity='1'; ip.style.visibility='visible';
  setTimeout(function(){
    ip.style.opacity='0';
    setTimeout(function(){ip.style.visibility='hidden';ipCooldown=false;},420);
  },2500);
}

/* ---- DIALOGUE ---- */
function pg(tid,n){return document.getElementById(tid+'-'+n);}
function fadeIn(el){
  if(!el)return;
  el.style.animation='none'; el.getBoundingClientRect();
  el.style.transformBox='fill-box'; el.style.transformOrigin='center';
  el.style.visibility='visible'; el.style.opacity='1'; el.style.pointerEvents='none';
  el.style.animation='fade-up-in 0.4s ease forwards';
}
function fadeOut(el,cb){
  if(!el){if(cb)cb();return;}
  el.style.animation='none'; el.getBoundingClientRect();
  el.style.animation='fade-down-out 0.32s ease forwards';
  setTimeout(function(){
    el.style.opacity='0'; el.style.visibility='hidden';
    el.style.animation=''; if(cb)cb();
  },340);
}

function startDlg(id){
  state='dialogue'; dlgId=id; dlgPage=1; dlgTransitioning=false;
  var cfg=CFGS[id];
  if(!cfg){collected.add(id);state='playing';contactCooldown=false;return;}
  var te=document.getElementById(cfg.t), be=document.getElementById(cfg.b);
  if(te){te.style.opacity='1';te.style.visibility='visible';}
  for(var i=1;i<=cfg.p;i++){var p2=pg(cfg.t,i);if(p2){p2.style.opacity='0';p2.style.visibility='hidden';p2.style.animation='';}}
  setTimeout(function(){fadeIn(pg(cfg.t,1));},60);
  if(be){
    be.style.animation='none'; be.getBoundingClientRect();
    be.style.visibility='visible'; be.style.opacity='1';
    be.style.transformBox='fill-box'; be.style.transformOrigin='center';
    setTimeout(function(){be.style.animation='fade-up-in 0.4s ease forwards, subtle-hover 3s ease-in-out 0.4s infinite';},60);
  }
}

function advanceDlg(){
  if(dlgTransitioning||!dlgId)return;
  var cfg=CFGS[dlgId]; if(!cfg)return;
  dlgTransitioning=true;
  var be=document.getElementById(cfg.b), curPg=pg(cfg.t,dlgPage);
  var nextPage=dlgPage+1, isLast=(dlgPage>=cfg.p);
  fadeOut(be,null);
  fadeOut(curPg,function(){
    if(!isLast){
      dlgPage=nextPage;
      fadeIn(pg(cfg.t,dlgPage));
      if(be){
        be.style.animation='none'; be.getBoundingClientRect();
        be.style.visibility='visible'; be.style.opacity='1';
        be.style.transformBox='fill-box'; be.style.transformOrigin='center';
        be.style.animation='fade-up-in 0.4s ease forwards, subtle-hover 3s ease-in-out 0.4s infinite';
      }
      dlgTransitioning=false;
    } else {
      /* end of dialogue */
      setTimeout(function(){
        var te=document.getElementById(cfg.t);
        if(te){te.style.transition='opacity 0.4s ease';te.style.opacity='0';
          setTimeout(function(){te.style.visibility='hidden';te.style.transition='';},450);}
        setTimeout(function(){
          var ie=document.getElementById(dlgId);
          if(ie){ie.style.transition='opacity 0.6s ease';ie.style.opacity='0';
            setTimeout(function(){ie.style.visibility='hidden';ie.style.transition='';},660);}
          var doneId=dlgId;
          collected.add(doneId);
          if(doneId==='stardust-3'){setTimeout(startOutro,750);}
          else{setTimeout(function(){state='playing';contactCooldown=false;dlgTransitioning=false;},700);}
        },500);
      },80);
    }
  });
}

/* ---- OUTRO ---- */
function startOutro(){
  state='outro';
  var oEl=document.getElementById('outro-text');
  if(oEl){
    oEl.style.transition='opacity 1s ease'; oEl.style.visibility='visible'; oEl.style.opacity='1';
    oEl.style.transformBox='fill-box'; oEl.style.transformOrigin='center';
    oEl.style.animation='subtle-hover 4s ease-in-out infinite';
  }
  setTimeout(function(){
    if(oEl){oEl.style.animation='';oEl.style.transition='opacity 1s ease';oEl.style.opacity='0';}
    setTimeout(function(){
      starEl.style.transition='opacity 0.3s ease';starEl.style.opacity='0';
      setTimeout(function(){starEl.style.visibility='hidden';},350);
      var sp=document.getElementById('star-pass');
      if(sp){
        positionSP(sp);
        sp.style.visibility='visible'; sp.style.transition='opacity 0.3s ease'; sp.style.opacity='1';
      }
      setTimeout(function(){
        var gEl=document.getElementById('glow-overlay');
        gEl.style.transition='opacity 1s ease'; gEl.style.opacity='0.97';
        setTimeout(function(){
          gEl.style.transition='opacity 0.7s ease'; gEl.style.opacity='0';
          if(sp){sp.style.transition='opacity 0.3s ease';sp.style.opacity='0';
            setTimeout(function(){sp.style.visibility='hidden';},350);}
          var gx=window.innerWidth/2, gy=window.innerHeight/2;
          if(sp){try{var rb=sp.getBoundingClientRect();gx=rb.left+rb.width/2;gy=rb.top+rb.height/2;}catch(e){}}
          setTimeout(function(){
            glitter(gx,gy);
            setTimeout(function(){
              var bEl=document.getElementById('black-overlay');
              bEl.style.transition='opacity 1s ease'; bEl.style.opacity='1';
              setTimeout(function(){
                document.getElementById('main-container').style.display='none';
                bEl.style.transition='opacity 0.3s ease'; bEl.style.opacity='0';
                var rw=document.getElementById('restart-wrapper'); rw.style.display='block';
                var rt=document.getElementById('restart-text');
                if(rt){rt.style.opacity='0';rt.style.transition='opacity 1.5s ease';
                  setTimeout(function(){rt.style.opacity='1';setTimeout(function(){state='ended';},1600);},200);}
                else setTimeout(function(){state='ended';},500);
              },1100);
            },2000);
          },700);
        },1400);
      },500);
    },500);
  },4000);
}

function positionSP(sp){
  try{
    var bb=sp.getBBox();
    var cx=bb.x+bb.width/2, cy=bb.y+bb.height/2;
    sp.setAttribute('transform','translate('+(SX+starDX-cx)+','+(SY+starDY-cy)+')');
  }catch(e){}
}

/* ---- GLITTER ---- */
function glitter(cx,cy){
  var cv=document.getElementById('glitter-canvas');
  cv.width=window.innerWidth; cv.height=window.innerHeight; cv.style.display='block';
  var ctx=cv.getContext('2d');
  var pts=[];
  for(var i=0;i<200;i++){
    var a=Math.random()*Math.PI*2, sp2=Math.random()*9+2;
    pts.push({x:cx,y:cy,vx:Math.cos(a)*sp2,vy:Math.sin(a)*sp2-3,
      sz:Math.random()*4.5+0.8,op:1,hue:Math.random()*60+25});
  }
  var fr=0;
  function draw(){
    ctx.clearRect(0,0,cv.width,cv.height);fr++;
    var alive=false;
    pts.forEach(function(p){
      p.x+=p.vx;p.y+=p.vy;p.vy+=0.22;p.vx*=0.975;p.op-=0.011;
      if(p.op<=0)return; alive=true;
      ctx.save(); ctx.globalAlpha=Math.max(0,p.op);
      ctx.fillStyle='hsl('+p.hue+',100%,'+(68+Math.random()*22)+'%)';
      star4(ctx,p.x,p.y,p.sz*1.6,p.sz*0.55); ctx.restore();
    });
    if(alive&&fr<160)requestAnimationFrame(draw);
    else{cv.style.display='none';ctx.clearRect(0,0,cv.width,cv.height);}
  }
  draw();
}
function star4(ctx,x,y,outer,inner){
  ctx.beginPath();
  for(var i=0;i<8;i++){
    var a=i*Math.PI/4-Math.PI/2, r=(i%2===0)?outer:inner;
    if(i===0)ctx.moveTo(x+r*Math.cos(a),y+r*Math.sin(a));
    else ctx.lineTo(x+r*Math.cos(a),y+r*Math.sin(a));
  }
  ctx.closePath(); ctx.fill();
}

/* ---- RESET ---- */
function resetGame(){
  if(state!=='ended')return;
  state='intro'; introKeyDone=false; starDX=0; starDY=0;
  collected.clear(); contactCooldown=false; dlgTransitioning=false;
  dlgId=null; dlgPage=1; ipCooldown=false;
  applyTf();
  document.getElementById('main-container').style.display='';
  document.getElementById('restart-wrapper').style.display='none';
  ['glow-overlay','black-overlay'].forEach(function(id){
    var el=document.getElementById(id); el.style.transition='none'; el.style.opacity='0';
  });
  starEl.style.cssText=''; starEl.style.opacity='1'; starEl.style.visibility='visible';
  if(introEl)introEl.style.cssText='';
  ['stardust-1','stardust-2','stardust-3','planet-1','planet-2','black-hole','dying-star'].forEach(function(id){
    var el=document.getElementById(id);
    if(el){el.style.transition='';el.style.opacity='1';el.style.visibility='visible';}
  });
  var rehide=['planet-1-text','planet-2-text','blackhole-text','dyingstar-text',
    'stardust-1-text','stardust-2-text','stardust-3-text',
    'instruction-prompt','outro-text','star-pass',
    'planet-1-nextbutton','planet-2-nextbutton','blackhole-nextbutton','dyingstar-nextbutton',
    'stardust-1-nextbutton','stardust-2-nextbutton','stardust-3-nextbutton'];
  rehide.forEach(function(id){
    var el=document.getElementById(id);
    if(el){el.style.opacity='0';el.style.visibility='hidden';el.style.animation='';
      el.style.transition='';el.style.transform='';el.style.pointerEvents='none';}
  });
  if(eggEl){
    eggEl.style.transformBox='fill-box'; eggEl.style.transformOrigin='center';
    eggEl.style.animation='subtle-hover 4s ease-in-out infinite';
  }
  window.scrollTo(0,0);
}

/* ---- BOOT ---- */
if(document.readyState==='loading')document.addEventListener('DOMContentLoaded',init);
else init();
})();

</script>
